DROP TABLE IF EXISTS mysql_all_types;
CREATE TABLE IF NOT EXISTS mysql_all_types(
c_boolean boolean,
c_bit bit,
c_tinyint tinyint,
c_smallint smallint,
c_mediumint mediumint,
c_integer integer,
c_bigint bigint,
c_decimal decimal,
c_float float,
c_double double,
c_char_255 char(255),
c_varchar_10000 varchar(10000),
c_binary_255 binary(255),
c_varbinary_10000 varbinary(10000),
c_date date,
c_time time,
c_datetime datetime,
c_timestamp timestamp,
PRIMARY KEY (c_boolean,c_bigint,c_date)
);
